import React, { useState, useEffect } from "react";

function ListMedicine() {
  const [products, setProducts] = useState([]); 
  const [loading, setLoading] = useState(true);

  // Fetch products from backend
  useEffect(() => {
    fetch("medical_store_app/api/medicines/")
      .then((response) => response.json())
      .then((data) => {
        setProducts(data);
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching products:", error);
        setLoading(false);
      });
  }, []);

  const handleDelete = (productName) => {
    fetch(`/api/medicines/${productName}/`, {
      method: "DELETE",
    })
      .then((response) => {
        if (response.ok) {
          setProducts(products.filter((product) => product.name !== productName));
        } else {
          console.error("Error deleting product");
        }
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  };

  const tableStyle = {
    width: "100%",
    borderCollapse: "collapse",
    marginTop: "20px",
  };

  const thStyle = {
    padding: "12px",
    backgroundColor: "#4CAF50",
    color: "white",
    textAlign: "left",
  };

  const tdStyle = {
    padding: "10px",
    borderBottom: "1px solid #ddd",
  };

  const deleteButtonStyle = {
    padding: "5px 10px",
    backgroundColor: "#f44336",
    color: "white",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
  };

  const containerStyle = {
    margin: "20px",
  };

  const titleStyle = {
    textAlign: "center",
    marginBottom: "20px",
  };

  if (loading) {
    return <div style={containerStyle}>Loading...</div>;
  }

  return (
    <div style={containerStyle}>
      <h2 style={titleStyle}>View Products</h2>
      <table style={tableStyle}>
        <thead>
          <tr>
            <th style={thStyle}>Medicine Name</th>
            <th style={thStyle}>Category</th>
            <th style={thStyle}>Price</th>
            <th style={thStyle}>Description</th>
            <th style={thStyle}>Stock Quantity</th>
            <th style={thStyle}>Action</th>
          </tr>
        </thead>
        <tbody>
          {products.length === 0 ? (
            <tr>
              <td colSpan="6" style={{ textAlign: "center" }}>No products available</td>
            </tr>
          ) : (
            products.map((product) => (
              <ProductRow
                key={product.name}
                product={product}
                onDelete={handleDelete}
                tdStyle={tdStyle}
                deleteButtonStyle={deleteButtonStyle}
              />
            ))
          )}
        </tbody>
      </table>
    </div>
  );
}

function ProductRow({ product, onDelete, tdStyle, deleteButtonStyle }) {
  return (
    <tr>
      <td style={tdStyle}>{product.name}</td>
      <td style={tdStyle}>{product.category}</td>
      <td style={tdStyle}>{product.price}</td>
      <td style={tdStyle}>{product.description}</td>
      <td style={tdStyle}>{product.stock}</td> {/* Display Stock Quantity */}
      <td style={tdStyle}>
        <button style={deleteButtonStyle} onClick={() => onDelete(product.name)}>
          Delete
        </button>
      </td>
    </tr>
  );
}

export default ListMedicine;
